INSERT INTO `beansconnecta`.`companies` (`id`, `name`, `description`, `address`, `city`, `scale`) VALUES ('1', 'Sun Asterisk', 'Hãy tưởng tượng ra một thế giới nơi tất cả mọi người đều được tự do tạo ra những giá trị tuyệt vời, có sức mạnh thay đổi cuộc sống. Chúng tôi theo đuổi đam mê của chính mình, cùng nhìn về tương lai. Không chỉ tồn tại, chúng tôi sống để thực hiện hóa những ước mơ.', 'Tầng 4, 16 Lý Thường Kiệt, Phường Thạch Thang, Quận Hải Châu, Đà Nẵng', 'Đà Nẵng', '200-300');
